var axios = require('axios');
var data = '';

var config = {
  method: 'get',
  url: 'http://localhost:30902/api/usuario?page=0&size=5&sort=username,asc&search=',
  headers: { 
    'Content-Type': 'application/json', 
    'Cookie': 'JSESSIONID=C832FC8CBAE1B82D9596326696A45118; TARENTOREG=0000000|false|0000000|10/03/202222:35:45'
  },
  data : data
};

axios(config)
.then(function (response) {
  console.log(JSON.stringify(response.data));
})
.catch(function (error) {
  console.log(error);
});
